    #MB n  hisoblash
    if(contentByte/(1024**2) >= 1):
        return str(contentByte/(1024**2))+' mb'
    #KB ni hisoblash
    if(contentByte/1024 >= 1):
        return str(contentByte/1024)+' kb'
    return str(contentByte)+ ' b'

